import React from 'react';
import './News.css'; // Import the CSS file

const News = () => {
  return (
    <div className="pest-control-container">
      <div className="pest">
        <h3>Pest Control</h3>
        <h3 className="pest-title">Creating Pest-Free Havens for Your Home:</h3>
        <h3 className="pest-subtitle">Your Sanctuary, Our Priority!</h3>
        <button className="pest-button">Explore</button>
        <div className="pest-img">
          <img src="/images/pest-control.jpg" alt="Pest Control" />
        </div>
      </div>
    </div>
  );
};

export default News;
